    false,nt"url": null,nt"notes": "This report provides a preliminary summary
    of field observations performed during the periods of 19-20 June and 26-29 June,
    1979, subsequent to the 10 June Trans-Alaska Pipeline break near the top of the
    north side of Atigun Pass. Objectives of the field surveys were to provide EPA,
    the RRT and the OSC with: (1) a preliminary assessment of the initial impact of
    the spill upon the Atigun Riverine Environment and relate such assessment to the
    effectiveness of the countermeasure underway and (2) a primary evaluation of the
    potential impacts that could further accrue from the spillage.",nt"license_title":
